var input = [];
input[0] = '';
input[1] = '';
input[2] = '';
input[3] = '';
input[4] = '';

var keypad = [[1,2,3],[4,5,6],[7,8,9]];
var x = 1;
var y = 1;

for (var i = 0; i < input.length; i++) {
	var inputs = input[i].split('');
	for (var ii = 0; ii < inputs.length; ii++) {
		if (inputs[ii] == 'U') {
			if (x > 0) {
				x -= 1;
			}
		}
		if (inputs[ii] == 'R') {
			if (y < 2) {
				y += 1;
			}
		}
		if (inputs[ii] == 'D') {
			if (x < 2) {
				x += 1;
			}
		}
		if (inputs[ii] == 'L') {
			if (y > 0) {
				y -= 1;
			}
		}
	}
	console.log('key[' + i + ']: ' + keypad[x][y]);
}
